import React from "react";
import App from "./App";

export default class Park extends React.Component {
    constructor(props, fullName, description, addresses) {
        super(props);
    }
    render() {
        return (

                <header className = "Park">
                    <h1>{ this.fullName }</h1>
                    <div>{ this.description }</div>
                    <div>{ this.addresses }</div>
                </header>

        )
    }
}
